class ShopMainListUserConnected extends Component {
    render() {
        return (
            <Fragment>
                <SubNavbar />

                <div className="site-section">
                    <div className="container">



                        <div className="row">
                            <div className="row col-md-12 ">

                                <ShopItem />
                                <ShopItem />
                                <ShopItem />




                            </div>




                        </div>



                    </div>
                </div>
            </Fragment>
        )
    }
}

export default ShopMainListUserConnected;
